      "account": "rashmika_mandanna",
      "caption": "Our November-December cover star Rashmika Mandanna (@rashmika_mandanna) is easily one of the most versatile young actors in the country, with a slew of blockbusters under her belt. In a heart-to-heart with Cosmo India Editor, Pratishtha Dobhal (@pratishtha_dobhal), the 28-year-old actor tells it like it is.\n\nExcerpt from the interview:\n\n‚ÄúI think I am a manifestation of destiny. Of course there are phases in life where you think ‚ÄòI want to be an actor‚Äô but I never thought it was a possibility. I was like, ‚ÄòWhatever comes in my life, I need to be the best at it‚Äô. It‚Äôs destiny that has got me here today‚Äîand this has come with a lot of patience, hard work, pushing my boundaries, learning everyday, and respecting my craft as an actor. So, even though I am a manifestation of destiny, I work hard for what I want.‚Äù\n\nHead to the link in bio to read her full cover interview! And don‚Äôt forget to grab a copy of the latest Cosmo India Nov-Dec issue.\n\nEditor and interview: Pratishtha Dobhal (@pratishtha_dobhal) \nDigital editor: Sonal Ved (@sonalved) \nPhotographer: Rahul Jhangiani (@rahuljhangiani)\nStylist: Zunaili Malik (@zunailimalik)\nCover design: Mandeep Singh (@mandy_khokhar19) \nEditorial coordinator: Shalini Kanojia (@shalinikanojia)\nMake-up artist: Tanvi Chemburkar (@tanvichemburkar)\nHair artist: Sourav Roy (@souravv_roy_)\nSet Design: Janhavi Patwardhan (@theartnut_j)\nFashion assistant: Saundarya (@thatlookielooks)\nFashion intern: Sanika Kukreja (@style.by.sanika) \nArtist Reputation Management: Spice PR (@spicesocial)\n\nOn Rashmika: Fur coat, Qua (@qua.clothing); sandaloo pumps, Christian Louboutin (@louboutinworld). \n\n#CosmopolitanIndia #CoverShoot #CosmoCoverStar #RashmikaMandanna",
