      "account": "rashmika_mandanna",
      "caption": "Pushpa 2 is releasing tomorrow and right now I am overwhelmed with emotions.. \n\nIt‚Äôs fascinating to see myself be so affected and so personally connected with this team and for a film.. never before have I ever let a film influence my emotions and today on the eve of the release I am feeling emotions I‚Äôve never felt for a film before. ‚ù§Ô∏è\n\nHmm.. where do I begin.. Pushpa started in 2021 but for me it started waaaay before that in covid times.. I remember the team coming to my house to train me for the chitoor slang to walking on the sets of Pushpa on day 1 the release of Pushpa 1 and then starting of Pushpa 2 shooting for Pushpa 2 for sooooo long.. everyday for the last 5 years talking about Pushpa.. \n\nSukku sir.. from the point of not knowing how to talk to him to the point where I am so so emotionally connected to him.. ‚ù§Ô∏è\nAllu Arjun sir.. from I point of being so scared of sir to even talk to sir to searching for him in our crowded set to ask if the shot was ok.. ‚ù§Ô∏è‚Äçüî•\nKuba sir the man of few words but the man when he smiles you know that, that shoot is freaking amazing!! \nMythri movie makers my home production from the point of fighting for dates to the last day of fighting for dates ü§£ü§£haha.. \nFahadh sir I got to work with you for 2 days and I‚Äôve heard you‚Äôve created absolute magic..on my way to watch it right now \nI love mythri.. they are the best! ‚ù§Ô∏è\nThese people mean so much to me! SO MUCH TO ME!\nI am so proud of us! I am so proud of how we started to how we are today! \nTeam Pushpa !! I love you! I love how hard we‚Äôve worked.. I love what we‚Äôve created today and I love how in sync we all are! I love it! ‚ù§Ô∏è\n\nEveryone works hard but success comes because of the people you surround yourself with. \nAnd Pushpa is the perfect example of it. ‚ù§Ô∏è",
